    "lpc-pronouns-ui.PronounsStrings.input.thirdSuggestion": "Ele/ele",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageFirstParagraphText": "Pronomes são as palavras que usamos para substituir o nome de alguém em uma frase, como \"ele,\" \"ela\" ou \"eles\". O campo de pronomes é um local opcional para você exibir seus pronomes para outras pessoas por meio do seu perfil.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageSecondParagraphText": "Usar corretamente os pronomes de alguém é uma maneira simples de mostrar que valorizamos ser inclusivos e respeitosos. Compartilhar pronomes quando você se apresenta ou no seu perfil contribui para criar um ambiente mais inclusivo e incentiva mais pessoas a compartilharem os deles também.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageTitle": "Pronomes no seu perfil",
    "lpc-pronouns-ui.PronounsStrings.learnMore.learnMoreAltText": "Saiba mais imagem",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageFirstParagraphText": "É importante não pressupor a identidade de gênero ou os pronomes de alguém com base em observações iniciais. Quando somos mencionados com o pronome errado, podemos nos sentir desrespeitados e invalidados. Ao investir na correção dos pronomes, mostramos que valorizamos ser inclusivos e atentos. Reserve um tempo para aprender os pronomes de uma pessoa ou pratique com pronomes que você não está familiarizado.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageSecondParagraphText": "Lembre-se de que os pronomes fazem parte da identidade de uma pessoa e da forma como nos expressamos. Compartilhar ou não os pronomes ou exibir pronomes é sempre uma decisão individual.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageTitle": "Evitando suposições",
